"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Polyarteritis nodosa (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/polyarteritis-nodosa-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H116244754\">",
"      <span class=\"h1\">",
"       What is polyarteritis nodosa?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Polyarteritis nodosa (called &ldquo;PAN&rdquo; here) is a condition that can cause problems with the kidneys, skin, and other parts of the body. It happens when certain blood vessels get inflamed. This can damage the blood vessels and keep them from carrying enough blood to body parts that need it.",
"     </p>",
"     <p>",
"      PAN is a serious condition. Often, people who do not get treatment die from it.",
"     </p>",
"     <p>",
"      PAN can happen in people who do not have other health problems. It can also happen in people who have certain diseases. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Lupus and rheumatoid arthritis &ndash; In these diseases, the body&rsquo;s infection-fighting system, called the &ldquo;immune system,&rdquo; attacks healthy cells.",
"       </li>",
"       <li>",
"        Infection with a virus, including hepatitis B, hepatitis C, and HIV &ndash; The HIV virus is the virus that causes AIDS.",
"       </li>",
"       <li>",
"        A type of cancer called &ldquo;hairy cell leukemia&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H116244768\">",
"      <span class=\"h1\">",
"       What are the symptoms of PAN?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Feeling tired",
"       </li>",
"       <li>",
"        Losing weight without trying",
"       </li>",
"       <li>",
"        Muscle pain and weakness",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Joint pain",
"       </li>",
"       <li>",
"        Skin changes &ndash; These are more common on the legs. They can include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Red bumps that hurt",
"       </li>",
"       <li>",
"        Red or purple spots on the skin that do not turn white when you press on them",
"       </li>",
"       <li>",
"        A purple pattern on the skin, which might be raised above the skin around it",
"       </li>",
"       <li>",
"        Open sores or blisters",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Numbness, tingling, and decreased feeling in the hands or feet &ndash; At first, this might happen on just 1 side of the body. It usually spreads to both sides.",
"       </li>",
"       <li>",
"        Belly pain &ndash; Some people have other symptoms of belly problems, such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Nausea and vomiting",
"       </li>",
"       <li>",
"        Diarrhea or blood in bowel movements",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Pain in the testicles (in men)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      PAN can also cause high blood pressure. This can be dangerous for your heart and other organs. Your doctor or nurse will tell you if you have it.",
"     </p>",
"     <p>",
"      Most people who have PAN have symptoms in several parts of the body at once. But PAN sometimes affects just 1 area, such as the skin.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H116244783\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will do an exam and learn about your symptoms. You might have some or all of these tests:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        Urine tests",
"       </li>",
"       <li>",
"        Chest X-ray &ndash; A chest X-ray creates a picture of your lungs. It can tell the doctor if you have PAN or a different condition. Some other diseases cause symptoms like those of PAN. These diseases usually affect the lungs.",
"       </li>",
"       <li>",
"        Electrocardiogram (ECG or EKG)&nbsp;&mdash; This test measures the electrical activity in your heart. PAN sometimes affects the heart.",
"       </li>",
"       <li>",
"        Biopsy &ndash; In this test, the doctor takes a small sample of tissue from a body part that has symptoms. Another doctor looks at the tissue under a microscope to check for signs of PAN.",
"       </li>",
"       <li>",
"        Arteriogram &ndash; For this test, the doctor injects a dye into an artery in a part of the body that is affected by PAN. The dye shows up on imaging tests, such as X-rays, CT scans, or MRIs. These imaging tests create pictures of the inside of the body. The dye can show problems with the blood vessels.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H116244797\">",
"      <span class=\"h1\">",
"       How is PAN treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors give medicines to control PAN and keep it from getting worse. Many people can take pills by mouth for PAN. But some people need medicine through an &ldquo;IV.&rdquo; This is a thin tube that goes into a vein.",
"     </p>",
"     <p>",
"      Treatment for PAN usually takes at least 6 months. It can take more than 1 year to get rid of symptoms. The medicines that treat PAN can cause serious side effects. Your doctor or nurse might give you other medicines to help keep these side effects from happening or make them less serious.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H116244811\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some medicines that treat PAN are not safe to take if you are pregnant. If you have PAN, ask your doctor or nurse if it is safe for you to get pregnant.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H116244827\">",
