"  </div>",
"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?8/59/9141/abstract/1\">",
"      Miller MR, Hankinson J, Brusasco V, et al. Standardisation of spirometry. Eur Respir J 2005; 26:319.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?8/59/9141/abstract/2\">",
"      Wang X, Dockery DW, Wypij D, et al. Pulmonary function between 6 and 18 years of age. Pediatr Pulmonol 1993; 15:75.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?8/59/9141/abstract/3\">",
"      Robbins DR, Enright PL, Sherrill DL. Lung function development in young adults: is there a plateau phase? Eur Respir J 1995; 8:768.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?8/59/9141/abstract/4\">",
"      Hankinson JL, Odencrantz JR, Fedan KB. Spirometric reference values from a sample of the general U.S. population. Am J Respir Crit Care Med 1999; 159:179.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"UTD.htm?8/59/9141/abstract/5\">",
"      Pellegrino R, Viegi G, Brusasco V, et al. Interpretative strategies for lung function tests. Eur Respir J 2005; 26:948.",
"     </a>",
"    </li>",
