var title_f8_59_9149="Pediatric pneumonia history";
var content_f8_59_9149=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F52510&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F52510&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Important aspects of the history in a child with pneumonia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Historical feature",
"       </td>",
"       <td class=\"subtitle1\">",
"        Possible significance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Age of the child",
"       </td>",
"       <td>",
"        <p>",
"         Viral etiologies are most common in infants and preschool children",
"        </p>",
"        Atypical bacterial pathogens are more common in school-age children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recent viral upper respiratory tract infection",
"       </td>",
"       <td>",
"        May predispose to bacterial superinfection with",
"        <em>",
"         Streptococcus pneumoniae",
"        </em>",
"        or",
"        <em>",
"         Staphylococcus aureus",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Associated symptoms",
"       </td>",
"       <td>",
"        <em>",
"         Mycoplasma pneumoniae",
"        </em>",
"        is often associated with extrapulmonary manifestations (eg, headache, photophobia, rash)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Presence of cough, chest pain, shortness of breath, difficulty breathing",
"       </td>",
"       <td>",
"        \"Classic\" features of pneumonia, but non-specific",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased work of breathing in the absence of stridor or wheezing",
"       </td>",
"       <td>",
"        Suggestive of severe pneumonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Choking episode",
"       </td>",
"       <td>",
"        May indicate foreign body aspiration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Duration of symptoms",
"       </td>",
"       <td>",
"        Chronic cough (&gt;4 weeks) suggests etiology other than acute pneumonia (refer to&nbsp;UpToDate topic on causes of chronic cough in children)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Previous episodes",
"       </td>",
"       <td>",
"        Recurrent episodes may indicate aspiration, congenital or acquired anatomic abnormality, cystic fibrosis, immunodeficiency, asthma, missed foreign body",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immunization status",
"       </td>",
"       <td>",
"        Completion of the primary series of immunizations for",
"        <em>",
"         Haemophilus influenzae",
"        </em>",
"        type b,",
"        <em>",
"         Streptococcus pneumoniae",
"        </em>",
"        ,",
"        <em>",
"         Bordetella pertussis",
"        </em>",
"        , and seasonal influenza decreases, but does not eliminate, the risk of infection with these organisms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Previous antibiotic therapy",
"       </td>",
"       <td>",
"        Increases the likelihood of antibiotic-resistant bacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maternal history of chlamydia during pregnancy (for infants &lt;4 months of age)",
"       </td>",
"       <td>",
"        May indicate",
"        <em>",
"         Chlamydia trachomatis",
"        </em>",
"        infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exposure to tuberculosis",
"       </td>",
"       <td>",
"        May indicate",
"        <em>",
"         Mycobacterium tuberculosis",
"        </em>",
"        infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ill contacts",
"       </td>",
"       <td>",
"        More common with viral etiologies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Travel to or residence in certain areas that suggest endemic pathogens",
"       </td>",
"       <td>",
"        <p>",
"         Measles: Developing world",
"        </p>",
"        <p>",
"         Coccidioidomycosis: Southwestern US, northern Mexico, Central and South America",
"        </p>",
"        <p>",
"         Blastomycosis: Southeastern and central US; states bordering the Great Lakes",
"        </p>",
"        <p>",
"         Histoplasmosis: Ohio, Missouri, and Mississippi River valleys in the United States; Canada; Central America; eastern and southern Europe; parts of Africa; eastern Asia; and Australia",
"        </p>",
"        Hantavirus: West of the Mississippi River; four corners region of United States (where borders of Colorado, New Mexico, Arizona, and Utah meet)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Animal exposure",
"       </td>",
"       <td>",
"        May indicate histoplasmosis, psittacosis, Q fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Day care center attendance",
"       </td>",
"       <td>",
"        Exposure to viruses and antibiotic-resistant bacteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fluid and nutrition intake",
"       </td>",
"       <td>",
"        Difficulty or inability to feed suggests severe illness",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
